import React from "react";
import { Route, Routes } from "react-router-dom";
import About from "./About";
import Contact from "./Contact";
import Service from "./Service";
import Menu from "./Menu";
import User from "./User";
import Search from "./Search";
import Error from "./Error";

const App = () => {
  const Name = () => {
    return <h1>Hello, This is name page</h1>;
  };
  return (
    <>
      <Menu />
      <Routes>
        <Route path="/" Component={() => <About name="About" />} />
        <Route path="/service" Component={() => <Service name="Service" />} />
        <Route path="/search" Component={() => <Search name="Search" />} />
        <Route path="/contact" Component={() => <Contact name="Contact" />} />
        <Route
          path="/user/:fname/:lname"
          Component={() => <User name="user" />}
        />
        <Route Component={Error} />
      </Routes>
      {/* <About />
        <Contact /> */}
    </>
  );
};

export default App;
